        function loadSelectBox() {
            const userId = document.querySelector('meta[name="wecui"]')?.getAttribute('content');
            const licenceId = document.querySelector('meta[name="lem-number"]')?.getAttribute('content');
            const website = document.querySelector('meta[name="website-url"]')?.getAttribute('content');
            const apiUrl = document.querySelector('meta[name="sponser"]')?.getAttribute('content');

            const selectBox = document.getElementById('keyword_block');
            const urlParams = new URLSearchParams(window.location.search);
            const form = urlParams.get('form');
            if (selectBox) {
                jQuery(selectBox).select2({
                    tags: true,
                    placeholder: "Select or type keywords"
                });

                if (userId) {
                    fetch(`${apiUrl}/keyword/selectBoxKeyword?user_id=${userId}&form_id=${form}`, {
                        method: 'GET',
                        headers: {
                            'LicenseKey': licenceId,
                            'websiteurl': website,
                            'Content-Type': 'application/x-www-form-urlencoded',
                            'Accept': 'application/json'
                        }
                    })
                        .then(response => response.json())
                        .then(data => {
                            const keywords = data.keyword_block;
                            console.log("Loaded keywords:", keywords);
                            if (Array.isArray(keywords)) {
                                keywords.forEach(keywordObj => {
                                    // const option = new Option(keywordObj.keyword, keywordObj.keyword, true, true);
                                    const option = new Option(keywordObj.keyword, keywordObj.id, false, false);
                                    selectBox.appendChild(option);
                                });

                                // jQuery(selectBox).val(keywords.map(k => k.keyword)).trigger('change');;
                            } else {
                                console.error('Invalid data structure:');
                            }
                        })
                        .catch(error => console.error('Error fetching data:', error));
                }
            }
        }

